public void testGetSetCommentStart() {
  CSVStrategy strategy = (CSVStrategy)CSVStrategy.DEFAULT_STRATEGY.clone();
  strategy.setCommentStart('#');
  assertEquals(strategy.getCommentStart(), '#');
  strategy.setCommentStart('!');
  assertEquals(strategy.getCommentStart(), '!');
}
